__NUXT_JSONP__("/svet/mesto/gbarnga", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w){return {data:[{place:[{id:j,id_state:k,name:l,population:83750,area:3.3,altitude:289,slug:m,information_chatgpt:a,coordinates:[{latitude:7.0042,longitude:-9.4768}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:n,value:e}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-04T19:48:29.85915+00:00",name_original:a,setting_top:e,setting_status_public:g}],imagePlace:[],placeState:[{tld:".lr",name:"Libérie",area:111369,population:5057681,slug:o,id_continent:f,information_chatgpt:"\u003Cp\u003ELibérie je země ležící na západním pobřeží Afriky, která má velmi bohatou historii a kulturu, ale také se potýká s mnoha výzvami a problémy. Byla založena v roce 1847 jako útočiště pro americké osvobozené otroky, a to se odráží i v místní kultuře a způsobu života.\u003C\u002Fp\u003E\n\u003Cp\u003ELibérie má mnoho přírodních krás, jako jsou krásné pláže, pralesy a horské oblasti, ale také mnoho historických památek a zajímavých míst k návštěvě. Mezi nejznámější patří například Sapo National Park, kde můžete vidět mnoho zvířat v přirozeném prostředí, nebo Cape Mount, což je jeden z nejkrásnějších přírodních rezervací v zemi.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho má Libérie bohatou kuchyni, která se skládá z různých místních surovin a je ovlivněna různými kulturami, jako jsou například africká, americká a evropská. Oblíbená jídla zahrnují například rýži s omáčkou z arašídů, rybí polévku a různé druhy masových pokrmů.\u003C\u002Fp\u003E\n\u003Cp\u003EBohužel však Libérie čelí mnoha problémům, jako je chudoba, nezaměstnanost a zvýšená kriminalita, což může omezit návštěvníky v plném prožití krás této země. Nicméně, pokud budete dodržovat základní bezpečnostní opatření a respektovat místní kulturu a zvyklosti, můžete si užít nádherné scenérie, kulturní památky a přátelskost místních lidí.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:h,date_update:b},{name:"Policie",value:"102",date_update:b},{name:"Hasiči",value:h,date_update:b},{name:"Zdravotnická záchranná služba",value:h,date_update:b}],phone_prefix:"+231",coordinates:[{latitude:"6.4281",longitude:"-9.4295"}],people_religion:[{name:"Křesťanství",value:"85 %"},{name:"Tradiční africká náboženství",value:p},{name:"Islám",value:"3 %"},{name:"Jiná náboženství",value:"2 %"}],people_nationality:[{name:"Kpelle",value:"20 %"},{name:"Bassa",value:"13 %"},{name:"Grebo",value:p},{name:"Gio",value:"8 %"},{name:"Mano",value:"7 %"},{name:"Kru",value:"6 %"},{name:"Liberijské Kreolští",value:"5 %"},{name:"Jiné",value:"31 %"}],visitors_entry:[{name:"Občanský průkaz",value:q,date_update:b},{name:"Cestovní pas",value:q,date_update:b},{name:"Vízum",value:"Pro občany České republiky není pro pobyt v Libérii vyžadováno vízum, pokud pobyt nepřesáhne 90 dnů. Pokud plánujete pobyt delší než 90 dnů nebo jiný druh cesty, kontaktujte prosím příslušné konzulární úřady.",date_update:b},{name:"Očkování",value:"Pro vstup do Libérie není povinné očkování. Nicméně je doporučeno být očkován proti žluté zimnici, pokud cestujete ze země, kde se vyskytuje tato choroba. Dále se doporučuje očkování proti hepatitidě A a B a tyfu.",date_update:b},{name:"Cestovní pojištění",value:"Cestovní pojištění není povinné, ale doporučuje se ho mít, protože lékařská péče v Libérii je velmi drahá a pokud byste byli hospitalizováni, mohlo by to být pro vás finančně náročné. Pokud však cestujete do Libérie jako zaměstnanec nebo dobrovolník, může být pojištění vyžadováno vaší organizací.",date_update:b},{name:"Bezpečnostní situace",value:"Bezpečnostní situace v Libérii je relativně nestabilní a turistům se doporučuje být ostražití, zejména v hlavním městě Monrovii. Měli byste být obezřetní při návštěvě méně turisticky vyhledávaných oblastí, zejména na hranicích s Pobřežím slonoviny a Guineou. Zvýšenou opatrnost byste měli věnovat nočnímu životu a při používání veřejné dopravy. Zdržujte se v uzavřených prostorech, kde se mohou konat veřejné akce.",date_update:b},{name:"Další informace",value:"V Libérii se doporučuje mít hotovost, protože platební karty nejsou všude přijímány. Pokud se chystáte cestovat mimo hlavní město, měli byste být připraveni na horší silnice a omezené zdroje. V Libérii se řídí vlevo. Je také vhodné si zjistit zvyklosti a kulturní normy země, například ohledně oblékání a chování na veřejnosti.",date_update:b}],type_place:r,id_image_cover:i,id_image_hero:i,id_city_main:s,affiliate:[{name:n,value:e}],mpz:"LR",alerts:a,zoom:[{google:t,booking:t}],ids_neighboring_countries:[{id:44},{id:86},{id:203}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:k,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"LRD",name:"liberijský dolar"}],setting_top:e,setting_status_public:g}],imageState:[{id:i,name:o,source:"\u002Fworld\u002Fstates\u002F",type:r,author:"unsplash.com\u002F@bethlaird",created_at:"2023-05-06T09:27:42.033044+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:2,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:u,date_update:u,author_create:v,author_update:v}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:e,setting_status_public:g}],placesCities:[{id:1280,id_image_cover:a,importance:d,slug:"bensonville",type_place:c,name:"Bensonville"},{id:1285,id_image_cover:a,importance:d,slug:"buchanan",type_place:c,name:"Buchanan"},{id:1286,id_image_cover:a,importance:d,slug:"ganta",type_place:c,name:"Ganta"},{id:j,id_image_cover:a,importance:d,slug:m,type_place:c,name:l},{id:1281,id_image_cover:a,importance:d,slug:"harper",type_place:c,name:"Harper"},{id:1283,id_image_cover:a,importance:d,slug:"kakata",type_place:c,name:"Kakata"},{id:s,id_image_cover:a,importance:d,slug:"monrovia",type_place:c,name:"Monrovia"},{id:1287,id_image_cover:a,importance:d,slug:"robertsport",type_place:c,name:"Robertsport"},{id:1282,id_image_cover:a,importance:d,slug:"voinjama",type_place:c,name:"Voinjama"},{id:1284,id_image_cover:a,importance:d,slug:"zwedru",type_place:c,name:"Zwedru"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{_error:{type:"system",errno:w,code:w,erroredSysCall:"read",message:"request to https:\u002F\u002Fapi.frytolnacestach.cz\u002Fapi\u002Fevents-id-city\u002F1279 failed, reason: read ETIMEDOUT",statusCode:500}}},mutations:[]}}(null,"05-2023","city","biggest",true,5,1,"911",414,1279,131,"Gbarnga","gbarnga","booking","liberie","10 %","Pro vstup do Libérie je třeba mít platný cestovní doklad, kterým může být jak občanský průkaz, tak i cestovní pas.","state",1278,7,"2024-03-01","1","ETIMEDOUT")));